// eventful

function addEventSimple(obj,evt,fn) {
	if (obj.addEventListener)
		obj.addEventListener(evt,fn,false);
	else if (obj.attachEvent)
		obj.attachEvent('on'+evt,fn);
}

function removeEventSimple(obj,evt,fn) {
	if (obj.removeEventListener)
		obj.removeEventListener(evt,fn,false);
	else if (obj.detachEvent)
		obj.detachEvent('on'+evt,fn);
}


// the dragDrop object

dragDrop = {
	initialMouseX: undefined,
	initialMouseY: undefined,
	startX: undefined,
	startY: undefined,
	draggedObject: undefined,
	
	initElement: function (element) {
		if (typeof element == 'string')
			element = document.getElementById(element);
		//element.onMouseDown = dragDrop.startDragMouse;
                addEventSimple(element,'mousedown',dragDrop.startDragMouse);

	},

	startDragMouse: function (e) {
		dragDrop.startDrag(this);
		var evt = e || window.event;
		dragDrop.initialMouseX = evt.clientX;
		dragDrop.initialMouseY = evt.clientY;
		addEventSimple(document,'mousemove',dragDrop.dragMouse);
		addEventSimple(document,'mouseup',dragDrop.releaseElement);
		return false;
	},


	startDrag: function (obj) {
		if (dragDrop.draggedObject)
			dragDrop.releaseElement();
		dragDrop.startX = obj.offsetLeft;
		dragDrop.startY = obj.offsetTop;
		dragDrop.draggedObject = obj;
		obj.className += ' dragged';
	},
	dragMouse: function (e) {
		var evt = e || window.event;
		var dX = evt.clientX - dragDrop.initialMouseX;
		var dY = evt.clientY - dragDrop.initialMouseY;
		dragDrop.setPosition(dX,dY);
		return false;
	},

	setPosition: function (dx,dy) {
		dragDrop.draggedObject.style.left = dragDrop.startX + dx + 'px';
		dragDrop.draggedObject.style.top = dragDrop.startY + dy + 'px';
		
		

	},


	releaseElement: function() {

		var d = GM_getValue("writeups","");


		draggedHTML = dragDrop.draggedObject.innerHTML.substring(dragDrop.draggedObject.innerHTML.indexOf('value="')+7,dragDrop.draggedObject.innerHTML.indexOf('src=')-2);
		draggedHTML2 = draggedHTML + "|" + dragDrop.draggedObject.style.left + "|" + dragDrop.draggedObject.style.top + ",";
		draggedHTMLArray = draggedHTML2.split("|");


		

		if(d !=''){

			if(d.indexOf("|"+draggedHTMLArray[2]+"|") != -1){

				

				d = d.replace(d.substring(d.indexOf(draggedHTML),d.indexOf(",",d.indexOf(draggedHTML))+1),draggedHTML2);
			
				

			}
			else
			{

				d = d + draggedHTML2;

			}


		}
		else
		{

			d = d + draggedHTML2;

		}

		GM_setValue("writeups", d);

		removeEventSimple(document,'mousemove',dragDrop.dragMouse);
		removeEventSimple(document,'mouseup',dragDrop.releaseElement);


		if(parseFloat(dragDrop.draggedObject.style.left) > -100 && parseFloat(dragDrop.draggedObject.style.left) < 40){

			if(parseFloat(dragDrop.draggedObject.style.top) > 1650 && parseFloat(dragDrop.draggedObject.style.top) < 1800){

				d = d.replace(draggedHTML2,'');
				GM_setValue("writeups", d);
				location.href = thisURL;
			}

		}


		dragDrop.draggedObject.className = dragDrop.draggedObject.className.replace(/dragged/,'');
		dragDrop.draggedObject = null;

		
		


	}

}

